    height: "100",
    backgroundImage: "url(" + { Bground } + ")"
};
export default class Home extends Component {
    render() {
        return (
            <div className="landing">
                <section style={sectionStyle}>
                </section>
                <h1>POST & TEACH</h1>
            </div>
        )
    }
}
